Description这个示例使用vtkOBBTree返回一条线和数据集的所有交叉点。如果你想要最近的交点，需要手动找到它。在本例中，我们创建了一个球体，并与之相交一条直线。
代码OBBTreeIntersectWithLine.cxx
#include &lt;vtkSmartPointer.h&gt;#include &lt;vtkSphereSource.h&gt;#include &lt;vtkPoints.h&gt;#include &lt;vtkPolyData.h&gt;#include &lt;vtkPointData.h&gt;#include &lt;vtkLine.h&gt;#include &lt;vtkOBBTree.h&gt;int main(int, char *[])&#123;  vtkSmartPointer&lt;vtkSphereSource&gt; sphereSource =     vtkSmartPointer&lt;vtkSphereSource&gt;::New();  sphereSource-&gt;Update();  // Create the locator  vtkSmartPointer&lt;vtkOBBTree&gt; tree =     vtkSmartPointer&lt;vtkOBBTree&gt;::New();  tree-&gt;SetDataSet(sphereSource-&gt;GetOutput());  tree-&gt;BuildLocator();  // Intersect the locator with the line  double lineP0[3] = &#123;0.0, 0.0, 0.0&#125;;  double lineP1[3] = &#123;0.0, 0.0, 2.0&#125;;  vtkSmartPointer&lt;vtkPoints&gt; intersectPoints =     vtkSmartPointer&lt;vtkPoints&gt;::New();  tree-&gt;IntersectWithLine(lineP0, lineP1, intersectPoints, NULL);  std::cout &lt;&lt; &quot;NumPoints: &quot; &lt;&lt; intersectPoints-&gt;GetNumberOfPoints()            &lt;&lt; std::endl;  // Display list of intersections  double intersection[3];  for(int i = 0; i &lt; intersectPoints-&gt;GetNumberOfPoints(); i++ )  &#123;    intersectPoints-&gt;GetPoint(i, intersection);    std::cout &lt;&lt; &quot;Intersection &quot; &lt;&lt; i &lt;&lt; &quot;: &quot;              &lt;&lt; intersection[0] &lt;&lt; &quot;, &quot;              &lt;&lt; intersection[1] &lt;&lt; &quot;, &quot;              &lt;&lt; intersection[2] &lt;&lt; std::endl;  &#125;  return EXIT_SUCCESS;&#125;
